import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { HttpService } from "../../map-section/services-map/http.service";
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { environment } from '../../../../environments/environment';

@Component({
  selector: 'app-adduser',
  templateUrl: './adduser.component.html',
  styleUrls: ['./adduser.component.css']
})
export class AdduserComponent implements OnInit {
  public profileForm: FormGroup;
  url: any;
  public base64image: any;
  public base64image_split: any;

  // fname = new FormControl();
  // lname: any;
  // uname: any;
  // mnum: any;
  // mail: any;
  public hide = true;
  adduserdetails: any;
  postId: any;
  img: string;
  main_data: any;
  success: any;
  ngxService: any;
  roles: any = [];
  role: any;
  name: any;


  constructor(private formBuilder: FormBuilder, private http: HttpClient, private _http: HttpService, private router: Router) {


    this.profileForm = new FormGroup({
      fname: new FormControl('', Validators.required),
      lname: new FormControl('', Validators.required),
      uname: new FormControl('', Validators.required),
      mail: new FormControl('', Validators.required),
      password: new FormControl('', Validators.required),
      role: new FormControl('', Validators.required),
      mnum: new FormControl('', Validators.required),


    });

  }

  ngOnInit(): void {

    const newtoken = localStorage.getItem("token");
    const headers = {
      'Authorization': 'Bearer ' + newtoken ,
      'Content-Type': 'application/json',
    };

    fetch(`${environment.api_name}api/accounts/role`, {
    method: 'GET',
    headers,
    credentials: 'omit'})
      .then(response => response.json())
      .then(datavalue => {
        // this.main_data = datavalue
        // // console.log(datavalue)
        // // console.log(datavalue.length)

        for (let index = 0; index < datavalue.length; index++) {

          if (datavalue[index]['name'] != 'superadmin') {
            this.roles.push(datavalue[index])

          }
          // // console.log(datavalue[index])


        }
        // this.roles = ['subuser']


      })


    if (this.base64image == undefined) {
      this.url = "../../../../assets/images/user_profile.png";
    }
  }
  onselectFile(e) {
    if (e.target.files) {
      var reader = new FileReader();
      reader.readAsDataURL(e.target.files[0]);
      reader.onload = (event: any) => {
        this.url = event.target.result;
        this.base64image = event.target.result;

        this.base64image_split = this.base64image.split('base64,');
        // // // console.log(this.base64image_split[1])

      }
    }

  }

  Selectrole(role) {
    this.role = role
    // alert(role)
  }
  gotomanageuser(fname, lname, uname, email, pwd) {
    // // console.log(this.role)
    this.adduserdetails = [];
    // alert(this.base64image_split[1])
    const user_id = localStorage.getItem("user_id");
    var post_url = environment.api_name + "api/accounts/create_project_users/"
    // // console.log(post_url)
    const newtoken = localStorage.getItem("token");
    // alert(this.base64image_split)
    if (this.base64image_split != undefined) {
      this.img = this.base64image_split[1]
    } else {
      this.img = ''
    }
    // // console.log(this.img)
    // const headers = { 'Authorization': 'Bearer '+newtoken}
    var userdata = {
      "username": uname,
      "firstname": fname,
      "lastname": lname,
      // "mobile_number": mnum,
      "email": email,
      "password": pwd,
      // "profile_pic": this.img,
      "role": "subuser",
      // "cnpassword" :cnpwd
    }
    // console.log(userdata)

    var httpOptions = {
        headers: new HttpHeaders({
            'Content-Type':  'application/json',
            'Authorization': 'Bearer ' + newtoken,
          }),
        withCredentials: false,
     };
    this.http.post(post_url, userdata, httpOptions).subscribe(data => {
      this.postId = data;
      this.success = data["status"]

      // alert(this.success)

      if (this.success == 'success') {

        // setTimeout(() => {
        //   this.ngxService.stop();
        // }, 2100)
        this.router.navigate(['app/manageuser'])
        location.reload();
      }
    })


    // this._http.setNewadduser({
    //   userdetailsfname: fname,
    //   userdetailslname: lname,
    //   userdetailsuname: uname,
    //   userdetailsmnum: mnum,
    //   userdetailsemail: email,
    //   userdetailspwd: pwd,
    // });

  }

  gotomanageuserpage() {
    this.router.navigate(['app/manageuser'])
  }
}
